import React, {useState} from 'react'
import {getNotes} from '../utils/noteHelpers'
import ListGroup from 'react-bootstrap/ListGroup'

/* N채r vi trycker p책 en note.
- highlight
- send note object as props to Form
*/
export default function List({selectedNote, setSelectedNote}) {
  const selectNote = (newNote) => {
    setSelectedNote(newNote)
  }

  return (
    <ListGroup as="ul">
      {getNotes().map((note, index) => (
        <ListGroup.Item
          active={selectedNote ? note.id === selectedNote.id : false}
          onClick={() => onSelectNote(note)}
          as="li"
        >
          {note.title}
        </ListGroup.Item>
      ))}
    </ListGroup>
  )
}
